import React from "react";
import "./Projects.css";

const Projects = ({projectData}) => {
    return (
        <div class="projects">
            <h2>{projectData.titles[3]}</h2>
            <div className="projects-content">
                {projectData.projects.map((project, index) => (
                    <div className="project" key={index}>
                        <div className="project-img" ></div>
                        <div className="project-details">
                            <h3>{project["project-header"]}</h3>
                            <span>{project["project-content"]}</span>
                            <div className="project-tags">
                                {project["project-tags"].map((tag, tagIndex) => (
                                    <a key={tagIndex}>{tag}</a>
                                ))}
                            </div>
                            <div className="project-links">
                                {project["project-links"].map((link, linkIndex) => (
                                    <a key={linkIndex} href={link.link}>{link["link-details"]}</a>
                                ))}
                            </div>
                        </div>
                    </div>
                ))}
            </div>
        </div>
    );
};

export default Projects;
